CREATE TABLE `IPX_FILE` (
  `FILESEQ` bigint(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '파일SEQ',
  `PAGEID` char(7) DEFAULT NULL COMMENT '페이지ID(공통코드)',
  `TABLENAME` varchar(50) DEFAULT NULL COMMENT '파일테이블',
  `FILEFK` bigint(11) unsigned DEFAULT NULL COMMENT '파일참조FK',
  `FILETYPE` varchar(500) NOT NULL COMMENT '파일타입',
  `FILENAMEREAL` varchar(500) NOT NULL COMMENT '실제물리파일이름',
  `FILENAMETEMP` varchar(500) DEFAULT NULL COMMENT '실제파일명',
  `FILEPATH` varchar(500) NOT NULL COMMENT '파일경로',
  `FILESIZE` varchar(20) NOT NULL COMMENT '파일크기',
  `CODEID` char(7) DEFAULT NULL COMMENT '제품코드ID(공통코드)',
  `WUSERSEQ` bigint(11) unsigned NOT NULL COMMENT '등록자',
  `WDATE` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE current_timestamp() COMMENT '등록일',
  `MUSERSEQ` bigint(11) unsigned DEFAULT NULL COMMENT '수정자',
  `MDATE` timestamp NULL DEFAULT NULL COMMENT '수정일',
  `FLAG` char(1) NOT NULL COMMENT '사용여부',
  `LOGSEQ` varchar(1000) DEFAULT NULL COMMENT '로그SEQ',
  PRIMARY KEY (`FILESEQ`)
) ENGINE=InnoDB AUTO_INCREMENT=1257 DEFAULT CHARSET=utf8 COMMENT='첨부파일';
