DROP TABLE IF EXISTS `IPX_PAGEPERMISSION`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `IPX_PAGEPERMISSION` (
  `PERMISSIONSEQ` bigint(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '권한관리SEQ',
  `PERMISSIONID` char(7) NOT NULL DEFAULT '' COMMENT '권한그룹ID',
  `PAGEID` char(7) NOT NULL COMMENT '페이지ID',
  `FUNC` char(1) NOT NULL COMMENT '등록권한',
  `FUNR` char(1) NOT NULL COMMENT '읽기권한',
  `FUNU` char(1) NOT NULL COMMENT '수정권한',
  `FUND` char(1) NOT NULL COMMENT '삭제권한',
  `RANGE` char(1) NOT NULL COMMENT '범위',
  `FLAG` char(1) NOT NULL COMMENT '사용여부',
  `WUSERSEQ` bigint(11) unsigned NOT NULL COMMENT '등록자',
  `WDATE` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE current_timestamp() COMMENT '등록일',
  `MUSERSEQ` bigint(11) unsigned DEFAULT NULL COMMENT '수정자',
  `MDATE` timestamp NULL DEFAULT NULL COMMENT '수정일',
  `LOGSEQ` varchar(5000) DEFAULT NULL COMMENT '로그Seq',
  PRIMARY KEY (`PERMISSIONSEQ`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=513 DEFAULT CHARSET=utf8 COMMENT='사용자별 페이지 권한';
/*!40101 SET character_set_client = @saved_cs_client */;

